INSERT INTO `companies` VALUES (1,'TopCV','TopCV','123','Công ty cổ phần TopCV',1234,'http://topcv.com',1,'1;2;3','sonat@gmail.com','235432','345345'),(2,NULL,'TEKY là Tổ chức giáo dục công nghệ STEAM K12 chuẩn Mỹ tiên phong và dẫn đầu tại Việt Nam với hệ sinh thái Học viện - Nền tảng edtech - Hợp tác trường, nhằm thực hiện sứ mệnh Đổi mới giáo dục, mang đến cho thế hệ trẻ Việt Nam kiến thức toàn diện về STEAM (Science - Technology - Engineering - Art - Math), đặc biệt là các tư duy công nghệ, khoa học máy tính và kỹ năng 4C của thế kỷ 21.','21','CÔNG TY CỔ PHẦN CÔNG NGHỆ & SÁNG TẠO TRẺ TEKY HOLDINGS',354,'https://teky.edu.vn/',76,'1;2;3',NULL,NULL,NULL),(3,NULL,'Thành lập năm 1999, Tổ chức Giáo dục FPT (FPT Education) là một trong các đơn vị thành viên của Tập đoàn FPT – Tập đoàn tiên phong trong lĩnh vực công nghệ thông tin của Việt Nam.','325','TỔ CHỨC GIÁO DỤC FPT',234,NULL,77,'1;2;3',NULL,NULL,NULL),(4,NULL,'Minigood là chuỗi cửa hàng bán lẻ mang Phong Cách Hàn Quốc. Là thương hiệu được yêu thích tại nhiều quốc gia, Minigood sở hữu hơn 1000 cửa hàng và hơn 20 cửa hàng tại Việt Nam.  Với mục tiêu trở thành thương hiệu nổi tiếng hàng đầu thế giới về hàng tiêu dùngKhông ngừng cung cấp sản phẩm chất lượng, sáng tạo, giá tốt cho người tiêu dùng trên','23','Công ty TNHH Minigood Việt Nam',2345,NULL,78,'1;2;3',NULL,NULL,NULL),(5,NULL,'Là Chuyên gia Chuyển đổi Kỹ thuật số (DX) ','321','Công Ty TNHH LG CNS VIỆT NAM',23,'https://careers.lgcnsvn.com/',79,'1;2;3',NULL,NULL,NULL),(6,NULL,'Với nhiều năm kinh nghiệm, chúng tôi đã kiến tạo không gian làm việc độc đáo, nơi mà sự sáng tạo và sự chuyên nghiệp hội tụ để tạo ra giá trị thực sự. Chúng tôi tự hào là đội ngũ chuyên gia bán hàng đa kênh với nền tảng vững chắc và cam kết mang lại giải pháp hiệu quả.',NULL,'CÔNG TY CỔ PHẦN POWER MEMBERSHIP CARD',58,'https://www.pmcard.vn/',80,'1;2;3',NULL,NULL,NULL),(7,NULL,'Tiền thân là Khối Tín dụng tiêu dùng trực thuộc Ngân hàng TMCP Việt Nam Thịnh Vượng (VPBank), FE CREDIT đã thành công trong việc chuyển đổi hoạt động Tín dụng tiêu dùng sang một pháp nhân độc lập mới với tên gọi Công ty Tài chính TNHH MTV Ngân hàng Việt Nam Thịnh Vượng (được nhận diện với Thương hiệu FE CREDIT) vào tháng 02/2015.','2567','FE CREDIT',32,'www.fecredit.com.vn',81,'1;2;3',NULL,NULL,NULL),(8,NULL,'Tập đoàn Viễn thông Quân đội Viettel - giữ vững vị thế Nơi làm việc tốt nhất Việt Nam trong 06 năm liên tiếp trong ngành Viễn thông, Hạ tầng, IT (theo khảo sát Anphabe) là nhà cung cấp dịch vụ số toàn cầu, luôn đi đầu trong đổi mới sáng tạo và luôn lắng nghe, thấu hiểu để đem tới những dịch vụ tốt nhất cho khách hàng.',NULL,'TẬP ĐOÀN CÔNG NGHIỆP - VIỄN THÔNG QUÂN ĐỘI',23,NULL,82,'1;2;3',NULL,NULL,NULL),(13,'Brief Intro','Detail Intro','123 nhân viên','Công ty cổ phần UpNext',NULL,'http://topcv.com',NULL,'1;2;3','upnext@gmail.com','00000000','123345'),(14,'Brief Intro','Detail Intro','123 nhân viên','Công ty cổ phần UpNext',NULL,'http://topcv.com',86,'1;2;3','upnext@gmail.com','00000000','123345'),(15,'Th true milk là công ty sữa','<p>Th true milk là công ty sữa</p>','500-1000 nhân viên','Công ty Sữa TH True Milk',NULL,'https://th.com',87,'8;9;18','th@gmail.com','13253546','235436547'),(16,'SONAT GAME STUDIO là công ty sản xuất game mobile toàn cầu','<p><strong>SONAT GAME STUDIO</strong>&nbsp;là công ty sản xuất game mobile toàn cầu - Top 1 Puzzle Game Việt Nam - hiện là các đối tác chiến lược của: Google, Apple, Facebook, Tiktok, Unity.&nbsp;</p><p>Với mục tiêu phát triển doanh nghiệp sánh ngang với các công ty đa quốc gia đứng đầu trên toàn thế giới, Sonat cần đến bạn - những mảnh ghép tài năng và bản lĩnh.</p><p>Hiện nay, Sonat đã có hàng chục sản phẩm thành công trên 2 chợ ứng dụng Google Play và App Store.</p><p>Đến với&nbsp;<strong>SONAT GAME STUDIO</strong>&nbsp;bạn sẽ được trải nghiệm:</p><p>- Công việc quy mô TOÀN CẦU</p><p>- Chế độ đãi ngộ ĐẲNG CẤP - LƯƠNG và THƯỞNG hấp dẫn</p><p>- Văn hóa và con người THÂN THIỆN</p><p>- Không gian văn phòng HẠNG A</p><p>- Đồ ăn, thức uống MIỄN PHÍ</p><p><strong>SONAT GAME STUDIO</strong>&nbsp;- Nơi làm việc hàng đầu dành cho bạn!</p><p>Chế độ,&nbsp;<strong>LƯƠNG và THƯỞNG</strong>&nbsp;hấp dẫn: Là thành viên của Sonat Game Studio bạn&nbsp;sẽ nhận được những quyền lợi xứng đáng, những chuyến du lịch ở resort 5 sao, chế độ lương và thưởng thuộc hàng top trong ngành.</p><p>Con người&nbsp;<strong>THÂN THIỆN</strong>: Từ công việc, đời sống, ăn uống, mọi người cùng nhau chia sẻ tạo nên sự thân thiết như một gia đình. Khi gia nhập công ty bạn chính là 1thành viên trong gia đình đó, bạn sẽ không cảm thấy xa cách hay lo lắng không hòa nhập được với các đồng nghiệp.</p><p>Đồ ăn&nbsp;<strong>THOẢI MÁI</strong>: Không phải tự nhiên công ty trang bị khu ăn uống và giải trí cho mọi người mà trong đó chứa đựng cả một thế giới đồ ăn. Công ty có riêng một khoảng thời gian bữa phụ cho cả nhà. Rất nhiều hoa quả, snack đang chờ bạn. Bạn thấy khát? Sẽ đủ loại nước ngọt đang vẫy gọi bạn. Bạn buồn ngủ? Hàng tá loại Cafe chờ bạn pha.</p><p><strong>Thứ 7 &amp; Chủ nhật</strong>&nbsp;máu chảy về tim: Được nghỉ thứ 7 và chủ nhật sau 1 tuần làm việc thì còn gì bằng. Không chỉ thứ 7 và chủ nhật đâu, các ngày lễ Tết khác sếp bên mình cực hiểu và tạo điều kiện cho nhân viên nghỉ xả hơi đó.</p>','25-99 nhân viên','SonatGame Studio',NULL,'https://www.sonat.vn/',94,'2;5;6;7','sonat@gmail.com','0383899192','3292302324'),(17,'Công ty Khoa học kỹ thuật','<p><strong>Công ty TNHH Khoa Học Kỹ Thuật CIG tiền thâ</strong>n là CIG power thành lập năm 1980 có trụ sở chính tại Đài Loan, Người sáng lập là Ông Daniel Huang. Trải qua hơn 35 năm kinh nghiệm và phát triển với phương châm “một chữ tín vạn niềm tin”. Chúng tôi luôn muốn đem lại cho bạn một dịch vụ chất lượng nhất với giá thành tốt nhất.</p><p>Chất lượng sản phẩm, dịch vụ bán hàng và sau bán hàng là ưu tiên hàng đầu trong việc xây dựng thương hiệu. CIG luôn tiên phong trong việc ứng dụng khoa học kỹ thuật, đầu tư các trang thiết bị hiện đại vào sản xuất. Nhằm cung cấp cho khách hàng những sản phẩm tối ưu về chất lượng, hoàn thiện về mẫu mã, giá cả phù hợp…..</p>','10-24 nhân viên','CÔNG TY TNHH KHOA HỌC KỸ THUẬT CIG',NULL,' http://cigpower.com',98,'3;4;6;2','test@gmail.com','2345346346','12423'),(19,'Brief Intro','Detail Intro','123 nhân viên','Công ty cổ phần UpNext 2',NULL,'http://topcv.com',106,'1;2;3','upnext@gmail.com','00000000','123345'),(20,'Là một trong những công ty tài chính số dẫn đầu tại Việt Nam','<p><span style=\"color: rgb(51, 51, 51);\">Là một trong những công ty tài chính số dẫn đầu tại Việt Nam, phục vụ hơn 16 triệu khách hàng trên toàn quốc trong suốt 16 năm qua. Với đội ngũ 6.000 nhân viên tận tâm, Home Credit cam kết thúc đẩy mạnh mẽ việc tiếp cận tài chính toàn diện và trao quyền làm chủ tài chính thông qua ứng dụng sáng tạo, tiên tiến và có trách nhiệm vào các sản phẩm.</span></p>','5000+ nhân viên','Công Ty Tài Chính TNHH Một Thành Viên Home Credit Việt Nam',NULL,'https://homecredit.vn/',107,'1;4;7;6','','','321098ddsm293'),(21,'Thành lập vào năm 2024, hướng tới mục tiêu trở thành một trong những công ty Internet','<p>Thành lập vào năm 2024, hướng tới mục tiêu trở thành một trong những công ty Internet hàng đầu tại Việt Nam, với hai dự án GoBuy và GoJob.</p><p>GoBuy Việt Nam với sứ mệnh mang lại trải nghiệm mua sắm trực tuyến tiện lợi và tin cậy, cam kết cung cấp “Sản phẩm hàng đầu, dịch vụ tốt nhất” cho khách hàng, đồng thời không ngừng kết nối và phát triển nhằm Hướng đáp ứng nhu cầu ngày càng cao của người tiêu dùng.</p><p>GoJob Việt Nam cam kết xây dựng một hệ sinh thái toàn diện trong lĩnh vực quản lý và phát triển nhân tài tại Việt Nam và khu vực Đông Nam Á. Chúng tôi không chỉ đơn thuần là một nền tảng kết nối giữa người lao động và doanh nghiệp, mà còn là một người đồng hành chiến lược trong việc phát triển nguồn lực con người, từ khâu tìm kiếm, tuyển dụng đến quá trình đào tạo, nâng cao kỹ năng và phát triển nghề nghiệp.</p><p>Founded in 2024, with the goal of becoming one of the leading Internet companies in Vietnam, through two projects: GoBuy and GoJob.</p><p>GoBuy Vietnam’s mission is to provide a convenient and reliable online shopping experience, committed to delivering \"Top products, best services\" to customers, while continuously evolving to meet the increasing demands of consumers.</p><p>GoJob Vietnam is committed to building a comprehensive ecosystem for talent management and development in Vietnam and Southeast Asia. We are not just a platform that connects workers and businesses, but also a strategic partner in developing human resources, from recruitment and training to skill enhancement and career development.</p>','25-99 nhân viên','CÔNG TY TNHH THƯƠNG MẠI ĐIỆN TỬ GOBUY VIỆT NAM',NULL,'https://gobuy.com',112,'1;5;6','gobuy@gmail.com','0986345234','123424543');
