NHAN_VIEN','Job Requirement',NULL,'Nhân Viên Tư Vấn Tuyển Sinh Chỉ Tuyển Nữ, Kinh Nghiệm Telesales Từ 6 Tháng Trở Lên',5,0,30,10,'2024-09-25 11:20:39.641053','10 triệu đồng','MALE',NULL,'FULLTIME',1,NULL,NULL,NULL),(26,'','2024-09-25 12:00:00.000000','ONLINE',_binary '',_binary '\0',_binary '\0','<p>Test1</p>','<p>Test1</p>','Chưa có kinh nghiệm','NHAN_VIEN','',NULL,'Test1',5,0,11,10,'2024-09-25 12:21:29.793005','11','MALE',NULL,'FULLTIME',1,NULL,NULL,NULL),(27,'','2024-09-25 12:05:00.000000','ONLINE',_binary '',_binary '\0',_binary '\0','<p>Test1</p>','<p>Test1</p>','Chưa có kinh nghiệm','NHAN_VIEN','',NULL,'Test1',5,0,11,10,'2024-09-25 12:21:45.007338','11','MALE',NULL,'FULLTIME',1,NULL,NULL,NULL),(28,'','2024-09-07 12:00:00.000000','ONLINE',_binary '',_binary '\0',_binary '\0','<ul><li>Thưởng theo hiệu suất công việc.</li><li>Thưởng năng lực vượt trội .</li><li>Xét duyệt lương hàng năm.</li><li>Lộ trình thăng tiến &amp; định hướng nghề nghiệp rõ ràng.</li><li>Các ngày nghỉ phép trong năm và hưởng chế độ phúc lợi theo quy định của công ty.</li><li>Tham dự các hoạt động nội bộ sôi nổi: sinh nhật hằng tháng, mini event, quà hỷ sự, thăm hỏi ốm đau, ...</li><li>Teambuilding hằng năm.</li></ul>','<ul><li>Triển khai, thực hiện các dự án liên quan đến Network cho các nhà mạng (ISP) và doanh nghiệp (Enterprise/Service Provider).</li><li>Triển khai vận hành hệ thống mạng</li><li>Hỗ trợ khách hàng xử lý lỗi/hỗ trợ tìm lỗi và hỗ trợ khắc phục lỗi trong và sau khi triển khai.</li><li>Triển khai các dự án tối ưu mạng lưới cho khách hàng.</li><li>Onsite thực hiện dự án khi có yêu cầu.</li><li>Đôn đốc, phân chia công việc cho các thành viên trong nhóm phù hợp với kỹ năng từng người, hỗ trợ các thành viên trong nhóm khi có yêu cầu.</li><li>Giám sát và báo cáo tiến độ công việc cho ban giám đốc.</li></ul><p><br></p>','Kinh nghiệm 1 năm','NHAN_VIEN','',NULL,'Network Engineer (ISP/Enterprise) - Tại Đà Nẵng',5,0,12,10,'2024-09-26 20:36:10.851286','346','MALE',NULL,'FULLTIME',1,NULL,NULL,NULL),(31,'','2024-09-18 04:00:00.000000','ONLINE',_binary '',_binary '\0',_binary '\0','<p>• Thu nhập cạnh tranh: Bao gồm lương cứng, tháng lương 13 và thưởng theo doanh số.</p><p>Competitive salary: Includes base salary, 13th-month bonus, and performance-based incentives.</p><p>• Chế độ bảo hiểm: Đầy đủ theo Luật lao động Việt Nam.</p><p>Full insurance: Provided according to the Vietnam Labor Law.</p><p>• Môi trường làm việc chuyên nghiệp, năng động: Cơ hội thăng tiến và phát triển sự nghiệp lâu dài.</p><p>Professional and dynamic working environment: Opportunities for long-term career development and growth.</p><p>• Bonus hấp dẫn: Thưởng hiệu suất dựa trên kết quả làm việc.</p><p>Attractive bonuses: Based on individual and team performance.</p>','<p><span style=\"color: rgb(51, 51, 51);\">• Tìm kiếm khách hàng tiềm năng: Chủ động tìm kiếm, tiếp cận và tư vấn các giải pháp chuỗi cung ứng, dịch vụ giao nhận vận tải trong nước và quốc tế cho doanh nghiệp.</span></p><p>Client acquisition: Actively seek, approach, and offer logistics and supply chain solutions for both domestic and international enterprises.</p><p>• Phát triển và duy trì quan hệ khách hàng: Lên kế hoạch tiếp cận khách hàng mới, đồng thời duy trì và mở rộng dịch vụ với khách hàng hiện có.</p><p>Develop and maintain customer relationships: Create plans to approach new clients while maintaining and expanding services to existing customers.</p><p>• Tư vấn dịch vụ: Tư vấn các gói dịch vụ xuất nhập khẩu, giải pháp vận chuyển, giao nhận, báo giá, thương thảo và ký kết hợp đồng dịch vụ với khách hàng.</p><p>Consultation and sales: Provide consultation on logistics, import/export services, and offer quotations; negotiate and finalize service contracts with clients.</p><p>• Phối hợp nội bộ: Hợp tác với các bộ phận khác để giải quyết các vấn đề phát sinh như khiếu nại, yêu cầu từ khách hàng.</p><p>Internal coordination: Collaborate with other departments to resolve any arising issues such as customer requests or complaints.</p><p>• Báo cáo và thực hiện các công việc khác: Thực hiện các nhiệm vụ khác theo yêu cầu của Ban Giám đốc và quản lý.</p><p>Reporting and other tasks: Perform tasks as assigned by the management team and Directors.</p>','Kinh nghiệm 1 năm','GIAM_DOC','<p>• Trình độ học vấn: Tốt nghiệp Đại học chuyên ngành Kinh tế, Logistics, Quản trị kinh doanh, Hàng hải.</p><p>Education: University degree in Economics, Logistics, Business Administration, or Maritime Studies.</p><p>• Kinh nghiệm: Ít nhất 2 năm kinh nghiệm ở vị trí Sales, ưu tiên kinh nghiệm dẫn dắt đội nhóm và Sales ngoài thị trường.</p><p>Experience: At least 2 years of experience in Sales, preferably with experience in leading a team and field sales.</p><p>• Kỹ năng giao tiếp và đàm phán xuất sắc: Có khả năng thuyết phục và tạo mối quan hệ tốt với khách hàng.</p><p>Excellent communication and negotiation skills: Strong ability to persuade and build relationships with clients.</p><p>• Ngoại ngữ: Sử dụng thành thạo tiếng Anh cả trong giao tiếp và viết.</p><p>Language skills: Proficient in English, both written and spoken.</p><p>• Kỹ năng quản lý và dẫn dắt đội ngũ: Có khả năng huấn luyện và hỗ trợ đội ngũ kinh doanh để đạt hiệu quả cao nhất.</p><p>Team management skills: Able to coach and lead the Sales team to maximize their potential.</p><p>• Kỹ năng tin học: Thành thạo Microsoft Office (Outlook, Excel, PowerPoint).</p><p>Computer skills: Proficient in Microsoft Office (Outlook, Excel, PowerPoint).</p>',NULL,'Nhân Viên Kinh Doanh/ Sales Logistics - Thu Nhập Từ 15 -35 Triệu Tại Hà Nội',5,0,34,10,'2024-09-26 21:17:34.659400','2323','FEMALE',NULL,'PROJECT_BASED',1,NULL,NULL,NULL),(32,'','2024-09-13 07:00:00.000000','ONLINE',_binary '',_binary '\0',_binary '\0','<p><br></p>','<p><br></p>','Kinh nghiệm 3 năm','NHAN_VIEN','<p><br></p>',NULL,'Kĩ Sư M&E Hiện Trường',5,0,12,10,'2024-09-26 21:28:13.898707','23','MALE',NULL,'DIRECTLY',1,NULL,NULL,NULL),(33,'','2024-09-14 12:00:00.000000','ONLINE',_binary '',_binary '\0',_binary '\0','<ul><li>Mức lương cạnh tranh, hấp dẫn (Thu nhập xứng đáng với ứng viên có năng lực)</li><li>Thưởng hiệu suất, thưởng học tập và các khoản thưởng khác theo quy định công ty</li><li>Thưởng tháng lương thứ 13 + thưởng theo tình hình hoạt động kinh doanh của công ty</li><li>Thử việc 100% lương</li><li>Tăng lương hàng năm (Nếu bạn thể hiện tốt sẽ được đề xuất linh động trong quá trình làm việc)</li><li>Chế độ bảo hiểm đầy đủ theo quy định của nhà nước ngay khi bạn gia nhập WNC</li><li>Cơ hội học hỏi, làm việc và phát triển trong công ty đa quốc gia</li><li>Chính sách đào tạo bài bản, rõ ràng phù hợp với quá trình phát triển của nhân sự</li><li>12 ngày nghỉ phép năm kèm các chế độ nghỉ khác như Nghỉ dưỡng đặc biệt / Nghỉ chăm vợ sinh/ Chăm sóc gia đình / Nghỉ ngày đèn đỏ đối với đồng nghiệp nữ...</li><li>Tham gia tổng kết cuối năm, ngày hội gia đình, tour du lịch hàng năm, hội thi thể thao, tiệc Giáng sinh, lễ hội khác... cùng công ty</li><li>Nghỉ 2 thứ 7/ tháng và tất cả các CN</li></ul>','<ul><li>Làm việc với các bộ phận liên quan để tiến hành các thủ tục khiếu nại của khách hàng/quy trình xử lý bất thường/bất thường về chất lượng, xác nhận và theo dõi các vấn đề bất thường để giải quyết hiệu quả và ngăn ngừa tái diễn.</li><li>Thực hiện kiểm tra sản phẩm mới và đánh giá rủi ro sản xuất để đảm bảo quy trình sản xuất đáp ứng nhu cầu của sản phẩm và khách hàng.</li><li>Hỗ trợ thực hiện các dự án cải tiến liên tục để đảm bảo thúc đẩy liên tục các hoạt động cải tiến chất lượng và cải thiện các chỉ số chất lượng khác nhau.</li><li>Xem lại quy trình quản lý thay đổi kỹ thuật để đảm bảo rằng các thay đổi được triển khai chính xác.</li><li>Triển khai các tiêu chuẩn kiểm tra sản phẩm và kế hoạch hạng mục kiểm tra để đảm bảo đồng nghiệp kiểm tra có thể thực hiện hoạt động kiểm tra theo đúng nội dung kiểm tra nhằm đảm bảo chất lượng sản phẩm đáp ứng yêu cầu vận chuyển.</li></ul>','Chưa có kinh nghiệm','CHUYEN_VIEN','<ul><li>Tốt nghiệp đại học, cao đẳng chuyên ngành có liên quan</li><li>Tiếng Trung tốt</li><li>Có kinh nghiệm tại vị trí tương đương</li><li>Trách nhiệm, nhiệt tình</li><li>Có tinh thần cầu tiến</li><li>Khả năng chịu được áp lực trong công việc</li></ul>',NULL,'Nhân Viên PQA',5,0,21,10,'2024-09-26 21:38:07.559928','321','MALE',NULL,'PARTTIME',1,NULL,NULL,NULL),(34,'','2024-09-26 21:38:00.000000','ONLINE',_binary '',_binary '\0',_binary '\0','<ul><li>Salary: Competitive Salary</li><li>Salary review once a year in December</li><li>Working 5 days/week (Monday to Friday)</li><li>Annual Leave is 12 days/year</li><li>Provide laptop and necessary equipment</li></ul>','<ul><li>Manage Operation team to ensure smooth daily deliveries and address any problems happening during the day.</li><li>Monitor to meet key operational KPIs on: On Time, Fill Rate, Incident Rate, Wastage Rate.</li><li>Measure and ensure productivity of Operation and Shipper team to meet cost KPI on Fulfillment Cost and Last Mile Cost.</li><li>Design KPI, bonus scheme and execute to improve lead time, accuracy and efficiency at every stage of the operation process.</li><li>Collaborate with relevant departments to address happening issues, execute inter-department projects to meet the company’s objectives.</li><li>Build excel base operation system and shift them to internal system with our internal tech team step by step.</li><li>Manage inventory, implement prevention methods to control operation loss.</li><li>Lead Delivery Ops team, address challenges related to shippers. Monitor and balance between in-house and external logistics parties for best efficiency.</li><li>Monitor overall operational system, ensure data readiness, security and smoothness for operation.</li><li>Collaborate with Technology team to design and implement long-term operation system.</li><li>Manage layouts, facilities, equipments in the warehouse.</li><li>Build long-term warehouse solution by equipping with lean process and modern technology and devices to boost the 